import { BrowserRouter, Routes, Route } from 'react-router-dom';
import ServiceForm from './components/ServiceForm';
import ServiceCategoryForm from './components/ServiceCategoryForm';
import CustomerForm from './components/CustomerForm';
import AppointmentForm from './components/AppointmentForm';
import CustomerList from './components/CustomerList';
import AppointmentList from './components/AppointmentList';
import Home from './pages/Home';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home />} />
        <Route path='/add-service' element={<ServiceForm />} />
        <Route path='/add-category' element={<ServiceCategoryForm />} />
        <Route path='/add-customer' element={<CustomerForm />} />
        <Route path='/add-appointment' element={<AppointmentForm />} />
        <Route path='/customers' element={<CustomerList />} />
        <Route path='/appointments' element={<AppointmentList />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
